import React, { useState } from "react";
import Card from "./UI/Card";
const Example = (props) => {
  const [title, setTitle] = useState(props.items);
  return (
    <Card>
      <h1>{title}</h1>
      <button onClick={titleChanger}></button>
    </Card>
  );
};

export default Example;
